INSERT INTO `tx_article_category` (`id`, `office_id`, `title`, `label`, `sequence`, `description`, `time_line`, `created_at`, `updated_at`, `created_by`, `updated_by`, `is_deleted`, `deleted_at`, `deleted_by`, `verlock`, `uuid`) VALUES
                                                                                                                                                                                                                                         (22, NULL, 'Serba-Serbi', 'darkred', 2, 'Pada kolom ini akan memuat informasi-informasi penting terkait Hubungan Internasional. Rencananya kolom ini akan memuat beberapa informasi penting yang sekiranya berkaitan dengan Hubungan Internasional seperti:\r\n\r\na.	Agenda Mahasiswa Hubungan Internasional\r\nSeperti diketahui bahwasanya mahasiswa hubungan interansional memiliki keaktifan dalam menjalin komunikasi antar sesame mahasiswa. Hal ini dapat dilihat dari forum yang mereka miliki yaitu Forum Komunikasi Mahasiswa Hubungan Internasional Indonesia atau yang biasa disingkat dengan (FKMHII). Forum ini tiap tahunnya rutin mengadakan pertemuan mahasiswa yang dikenal dengan Pertemuan Nasional Mahasiswa Hubungan Internasional se-Indonesia (PNMHII) dengan mengambil tempat berbeda tiap tahunnya. kolom ini juga dapat menjadi sarana untuk mempromosikan agenda mahasiswa dari masing-masing kampus seperti misalnya lomba debat antar mahasiswa HI, simulasi sidang Model United Nations (MUN) ataupun agenda mahasiswa lainnya.\r\n\r\nTeknis pemberian informasi terkait informasi event adalah sebagai berikut:\r\n	Informan memberikan data dari event yang akan diadakan seperti tanggal, lokasi, registrasi dll.\r\n	Event memiliki konten yang berkaitan dengan hubungan internasional\r\n\r\nb.	Agenda dosen Hubungan Interansional\r\nPada kolom ini lebih ditujukan untuk agenda-agenda dosen hubungan Internasional seperti pertemuan Asosiasi Ilmu Hubungan Internasional Indonesia (AIHII) yang rutin diadakan setiap tahunnya dengan mengambil lokasi yang berbeda. Kolom ini juga dapat digunakan untuk informasi seminar-seminar yang bertaraf nasional maupun internasional ataupun general lecture.\r\nTeknis pemberian informasi terkait informasi event adalah sebagai berikut:\r\n	Informan memberikan data dari event yang akan diadakan seperti tanggal, lokasi, registrasi dll.\r\n	Event memiliki konten yang berkaitan dengan hubungan internasional\r\n\r\nc.	Info Prodi Hubungan Internasional di Indonesia\r\nKolom ini berusaha untuk memberikan informasi penting tentang Studi Hubungan Internasional di Indonesia seperti misalnya jumlah prodi S1, S2 dan S3 Hubungan internasional yang ada di Indonesia, kemudian informasi tentang jurnal Hubungan Internasional dengan level nasional terakreditasi di Indonesia (ada berapa jumlahnya, nama jurnalnya, universitasnya dan CPnya). ', 1, '2018-03-28 13:00:48', '2020-10-20 00:30:57', 1, 1, 0, NULL, NULL, 10, ''),
                                                                                                                                                                                                                                         (23, NULL, 'Artikel', 'darkred', 3, 'Kolom ini khusus untuk HI Bro, HI Sis, Hi Sir dan Hi Maam yang ingin berbagi cerita tentang perjalanan ke luar negeri untuk memberikan gambaran terhadap para pembaca. Kolom ini dapat berisi profil dari Hi Bro, Hi Sis, Hi Sir atau HI Maam ataupun liputan perjalanan ke luar negeri dari HI temans sekalian, ataupun liputan mengikuti event-event tertentu dalam hubungan internasional seperti sidang antar bangsa ataupun hal lain yang berkaitan', 1, '2018-03-28 13:03:32', '2020-10-20 00:31:23', 1, 1, 0, NULL, NULL, 5, ''),
                                                                                                                                                                                                                                         (24, NULL, 'Buku', 'darkred', 4, 'Kolom ini berisikan materi-materi yang disampaikan dalam mata kuliah HI. tulisan bisa terdiri dari teori-teori dasar yang tujuannya adalah memberikan pengetahuan dasar kepada pembaca ataupun kajian-kajian yang sifatnya lebih intensif lagi', 1, '2018-07-15 20:52:51', '2020-10-20 11:21:43', 1, 1, 0, NULL, NULL, 4, ''),
                                                                                                                                                                                                                                         (25, NULL, 'Opini', 'darkred', 5, 'Tema untuk rubrik opini terdiri dari tiga. Pertama, opini dengan tema Hubungan Internasional. Kedua, opini tentang dunia pendidikan di Indonesia. Ketiga, opini tentang dinamika perkuliahan. \r\n\r\nide dan gagasan dalam rubrik ini wajib merupakan milik dari si penulis dan belum pernah dipublish di manapun\r\n\r\ntulisan dalam rubrik opini terdiri dari 800-1000 kata\r\n\r\npenulis bertanggung jawab penuh pada konten yang dituliskan dalam opininya tersebut', 1, '2019-07-24 21:11:30', '2020-10-20 00:31:30', 1, 1, 0, NULL, NULL, 2, ''),
                                                                                                                                                                                                                                         (26, 1, 'Budaya', 'primary', 1, '', 1, '2024-07-25 23:06:44', '2024-07-25 23:06:44', 1, 1, NULL, NULL, NULL, 0, 'e386bc684a9f11efbeddc858c0b7f92f');

